  return (
    <div className="Mypage">
      <Header></Header>
      <section class="vh-100 gradient-custom body">
        <div class="container py-5">
            
      
            <div class="row d-flex justify-content-center text-center align-items-center h-100">
            <h2 class="fw-bold mb-2">My Information</h2>
            <div class="inform-card col-12 col-md-8 col-lg-6 col-xl-5">
                <div class="card bg-white text-black">
                <div class="card-body p-5 text-center">
                    <div class="row">
                        <div class="col"> Name: </div>
                        <div class="col-6"> Hyewon</div>
                    </div>
                

               
                </div>
                </div>
            </div>
            </div>
        </div>
        </section>
        
     </div>

  );
}

export default Mypage;
